function style(feature) {
	if(feature.geometry_name == "Shape") {
		return {
		 color: '#22ff00',
         weight: 4.5,
         opacity: 0.9,
         fillOpacity: 0.1
      }
	}
	else  {
    	return {
         color: '#FF0000',
         weight: 2.5,
         opacity: 0.9,
         fillOpacity: 0.1
        }
    }
};

function style2(feature) {
    return {
     color: '#ee940a',
         weight: 4.5,
         opacity: 0.9,
         fillOpacity: 0.1
      }
  };

function style3(feature) {
    return {
     color: 'black',
         weight: 4.5,
         opacity: 0.9,
         fillOpacity: 0.1
      }
  };


function style4(feature) {
    return {
     color: '#22ff00',
         weight: 4.5,
         opacity: 0.9,
         fillOpacity: 0.1
      }
  };

function style5(feature) {
    return {
     color: '#0000FF',
         weight: 4.5,
         opacity: 0.9,
         fillOpacity: 0.1
      }
  };

  function style5(feature) {
    return {
     color: '#0000FF',
         weight: 4.5,
         opacity: 0.9,
         fillOpacity: 0.1
      }
  };

  function style6(feature) {
    return {
     color: '#FFE33D',
         weight: 4.5,
         opacity: 0.9,
         fillOpacity: 0.1
      }
  };

function highlightFeatureA(border) {
	var layer = border.target;
	layer.setStyle ({
		weight: 5,
        color: '#FF0000',
        fillOpacity: 0.3
})
 if (!L.Browser.ie && !L.Browser.opera) {
        layer.bringToFront();
    }
};

function highlightFeatureB(border) {
  var layer = border.target;
  layer.setStyle ({
    weight: 5,
        color: '#ee940a',
        fillOpacity: 0.6
})
 if (!L.Browser.ie && !L.Browser.opera) {
        layer.bringToFront();
    }
};
function highlightFeature(border) {
  var layer = border.target;
  layer.setStyle ({
    weight: 10,
        color: '#22ff00',
        fillOpacity: 0.3
})
 if (!L.Browser.ie && !L.Browser.opera) {
        layer.bringToFront();
    }
};

function highlightsecurityFence(border) {
  var layer = border.target;
  layer.setStyle ({
    weight: 10,
        color: '#424242',
        fillOpacity: 0.3
})
 if (!L.Browser.ie && !L.Browser.opera) {
        layer.bringToFront();
    }
};

function highlightarmyBase(border) {
  var layer = border.target;
  layer.setStyle ({
    weight: 10,
        color: '#a3a3f4',
        fillOpacity: 0.3
})
 if (!L.Browser.ie && !L.Browser.opera) {
        layer.bringToFront();
    }
};

function highlightUN(border) {
  var layer = border.target;
  layer.setStyle ({
    weight: 10,
        color: '#FFE33D',
        fillOpacity: 0.6
})
 if (!L.Browser.ie && !L.Browser.opera) {
        layer.bringToFront();
    }
};

function resetUN(border) {
    undof.resetStyle(border.target);
}

 function resetsecurityFence(border) {
    securityFence.resetStyle(border.target);
}

 function resetgreenLine(border) {
    greenLine.resetStyle(border.target);
}

 function resetHighlightB(border) {
    areaB.resetStyle(border.target);
}

 function resetHighlightA(border) {
    areaA.resetStyle(border.target);
}

function resetarmyBase(border) {
   armyBase.resetStyle(border.target);
}

function onEachFeaturearmyBase (feature, layer) {
    layer.on({
        mouseover: highlightarmyBase,
        mouseout: resetarmyBase,
    })  
    if (feature.properties.popupContent) {
        layer.bindPopup(feature.properties.popupContent);
    }
};


function onEachFeatureA (feature, layer) {
    layer.on({
        mouseover: highlightFeatureA,
        mouseout: resetHighlightA,
    })	
    if (feature.properties.popupContent) {
        layer.bindPopup(feature.properties.popupContent);
    }
};

function onEachFeatureB(feature, layer) {
    layer.on({
        mouseover: highlightFeatureB,
        mouseout: resetHighlightB,
    })  
    if (feature.properties.popupContent) {
        layer.bindPopup(feature.properties.popupContent);
    }
};

function onEachFeaturegreenLine(feature, layer) {
    layer.on({
        mouseover: highlightFeature,
        mouseout: resetgreenLine,
    })  
    if (feature.properties.popupContent) {
        layer.bindPopup(feature.properties.popupContent);
    }
};

function onEachFeaturesecurityFence(feature, layer) {
    layer.on({
        mouseover: highlightsecurityFence,
        mouseout: resetsecurityFence,
    })  
    if (feature.properties.popupContent) {
        layer.bindPopup(features.properties.popupContent);
    }
};

function onEachFeatureUN(feature, layer) {
    layer.on({
        mouseover: highlightUN,
        mouseout: resetUN,
    })  
    if (feature.properties.popupContent) {
        layer.bindPopup(features.properties.popupContent);
    }
};

var undof = L.geoJson(undof, {
    style: style6,
    onEachFeature: onEachFeatureUN
}).addTo(map);

var securityFence = L.geoJson(securityFence, {
    style: style3,
    onEachFeature: onEachFeaturesecurityFence
}).addTo(map);

var greenLine = L.geoJson(greenLine, {
    style: style4,
    onEachFeature: onEachFeaturegreenLine
}).addTo(map);

var golan =L.geoJson(golan, {
  style: style4,
  onEachFeature: onEachFeaturegreenLine
}).addTo(map);

var areaB = L.geoJson(areaB, {
    style: style2,
    onEachFeature: onEachFeatureB
}).addTo(map);

var areaA = L.geoJson(areaA, {
    style: style,
    onEachFeature: onEachFeatureA
}).addTo(map);

var armyBase = L.geoJson(armyBase, {
    style: style5,
    onEachFeature: onEachFeaturearmyBase
}).addTo(map);

  
function getColor(d) {
    return d == "Area A: Palestinian Security Control" ? '#FF0000' :
           d == "Area B: Palestinian Civil Control"  ? '#ee940a' :
           d == "United Nations Disengagement Zone" ? '#FFE33D' :
           d == "Israeli Military Base" ? 'blue' :
           d  == "Green Line (1949 Ceasfire Line)" ? '#22ff00' :
           d  == "Security Wall" ? 'black' :
                                      'black';         
}

var legend = L.control({position: 'topleft'});

legend.onAdd = function (map) {
  var div = L.DomUtil.create('div', 'info legend');
    categories = ['Area A: Palestinian Security Control','Area B: Palestinian Civil Control','United Nations Disengagement Zone','Israeli Military Base', 'Green Line (1949 Ceasfire Line)', "Security Wall"]

    for (var i = 0; i < categories.length; i++) {
        div.innerHTML +=
            '<i style="background:' + getColor(categories[i]) + '"></i> ' +
             (categories[i] ? categories[i] + '<br>' : '+');
    }

    return div;
};

legend.addTo(map); 

